import React from 'react'; 
import ReactDOM from 'react-dom';
import jsPDF from 'jspdf'

export default class Confirm extends React.Component{

    constructor(props){
        super(props);
    }
      

    render(){
        var imgData ='data:image/jpeg;base64,';
        var doc = new jsPDF();
        doc.setFontSize(24);
        doc.text(20, 20, this.props.summary.name);

        doc.setFontSize(24);
        doc.text(20, 30, this.props.summary.tribe.toString());
        doc.addImage(imgData, 'JPEG', 20, 40, 180, 160)
        var val = doc.output('dataurlstring', {});

        return(
            <div id="welcome" class="welcome">
                <h1 class="text-center" id="welcome-title">welcome home</h1>
                <h3 class="text-center">Confirm your information</h3>
                <div class="row">
                    <div class="col-md-12 wrapper">
                        <ul role="menu">
                                <li>{this.props.summary.name}</li>
                                <li>{this.props.summary.dob.toString()}</li>
                                <li>{this.props.summary.tribe}</li>
                        </ul>              
                        <button class="btn btn-default btn-strong" type="button" id="startbutton">Proceed</button>
                    </div>
                    <div class="col-md-12 wrapper">
                        <iframe  width="100%" height="500px" type="application/pdf" src={val}></iframe>
                    </div>                   
                </div>
            </div>
        );
    }
}

